import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule } from '@angular/common/http'; // Asegúrate de que esta línea esté presente
import { AppComponent } from './app.component';
import { ProductService } from './adapters/product.repository.adapter';
import { MainPageComponent } from 'src/components/main-page/main-page.component';

@NgModule({
  declarations: [
    AppComponent,
    MainPageComponent
  ],
  imports: [
    BrowserModule,
    HttpClientModule // Asegúrate de que esta línea esté presente
  ],
  providers: [ProductService], // Opcional, ya que usamos providedIn: 'root' en el servicio
  bootstrap: [AppComponent]
})
export class AppModule { }
